tests.code:
cy.visit(Cypress.env('ApiTestURL'));
cy.intercept('GET', 'https://rahulshettyacademy.com/Library/GetBook.php?AuthorName=shetty', req => {
  req.url = "https://rahulshettyacademy.com/Library/GetBook.php?AuthorName=malhotra";
  req.continue(res => {// expect(res.statusCode).to.equal(403)
  });
}).as("dummyUrl");
cy.get("button[class='btn btn-primary']").click();
cy.wait('@dummyUrl');

cy.visit(Cypress.env('ApiTestURL'));
cy.intercept({
  method: 'GET',
  url: Cypress.env('RSAPI')
}, {
  statusCode: 200,
  body: [{
    "book_name": "RestAssured with Java",
    "isbn": "RSU",
    "aisle": "2301"
  }]
}).as('bookretrievals');
apiTest.primaryButton().click();
cy.wait('@bookretrievals').should(({
  request,
  response
}) => {
  cy.get('tr').should('have.length', response.body.length + 1);
});
cy.get('p').should('have.text', 'Oops only 1 Book available'); //length of the response array = rows of the table
//#endregion ApiTest

cnatt.getDisplacementCalendarTextBox().click({
  force: true
});
cnatt.getRescheduleStartDate().click({
  force: true
});
cnatt.getRescheduleEndDate().click({
  force: true
});
cnatt.getOutside();
cnatt.getScrollDown();
cnatt.getImpactDatesNextButton().click();
cnatt.getCreateCSVHeader().contains('Prometric-Initiated Displacement Form');

cnatt.getScrollDown();
cnatt.getCSVPreviewNextButton().click();
cnatt.getDownloadCSVHeader().contains('Your .csv file is ready to download');

const prometric = new _PrometricTest.default();
cy.visit(Cypress.env('PrometricVerifyurl'));
prometric.getVerifyWelcomeText().contains('Your full name must match what is on your government-issued ID.​');

const prometric = new _PrometricTest.default();
