const prometric = new _PrometricTest.default();
cy.visit(Cypress.env('PrometricVerifyurl'));
prometric.getMakeAChangeLink().click();
prometric.getModalHeader().contains('Please contact your test sponsor to update your personal information.');

homePage.getEditBox().type(this.data.name);
homePage.getGender().select(this.data.gender);
homePage.getTwoWayDataBinding().should('have.value', "Darshit");
homePage.getEntrepreneaur().should('be.disabled');
Cypress.config('defaultCommandTimeout', 8000);
homePage.getSubmitButton().click();
homePage.getSubmitFormMessage().contains('Success! The Form has been submitted successfully!.');

homePage.getShopTab().click();
homePage.getAddToCart1().click();
homePage.getAddToCart2().click();
homePage.getCheckout().click();
homePage.getCheckoutButton().click();
homePage.getCountryTextBox().type('India');
homePage.getSuggestionOption().click();
homePage.getAgreeCheckBox().click();
homePage.getPurchasedButton().click();
homePage.getOrderSuccessfullMessage().contains('Success! Thank you! Your order will be delivered in next few weeks :-).');

//Check boxes
cy.visit(Cypress.env('TestWebControlURL'));
webControl.getcheckBoxOption1().check().should('be.checked').and('have.value', 'option1');
webControl.getcheckBoxOption1().uncheck().should('not.be.checked');
webControl.getcheckBox().check(['option2', 'option3']); //Static Dropdown
webControl.getcheckBoxOption2().should('have.value', 'option2'); //Dynamic dropdowns
webControl.getAutoComplete().type('ind');
cy.get('.ui-menu-item div').each(($e1, index, $list) => {
  if ($e1.text() === "India") {
    $e1.click();
  }
}); //autocomplete
webControl.getAutoComplete().should('have.value', 'India'); //visible invisible
webControl.getDisplayedTextBox().should('be.visible');
webControl.getHideTextBox().click();
webControl.getDisplayedTextBox().should('not.be.visible');
webControl.getshowTextBox().click();
webControl.getDisplayedTextBox().should('be.visible'); //radio buttons
webControl.getRadioButton().check().should('be.checked');

//Check boxes
cy.visit(Cypress.env('TestWebControlURL'));
webControl.getAlertButton().click();
webControl.getConfirmButton().click();
cy.on('window:alert', str => {
  //Mocha
  expect(str).to.equal('Hello , share this practice page and share your knowledge');
});
cy.on('window:confirm', str => {
  //Mocha
  expect(str).to.equal('Hello , Are you sure you want to confirm?');
});
webControl.getOpenTab().invoke('removeAttr', 'target').click();
cy.url().should('include', 'rahulshettyacademy');
cy.go('back');

